import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style';

class List extends Component {
	render() {
		return (
			<ListItem>
				<img className='listPic'/>
				<ListInfo>
					<h3 className='title'></h3>
					<p className='desc'></p>
				</ListInfo>
			</ListItem>
		)
	}
}

export default List;
